import React, { Component } from "react";
import Navigation from "./components/Navigation";
import HomePage from "./views/HomePage";
import { getRequest } from "./requests/axiosLocalHost";

class App extends Component {
  constructor() {
    super();
    this.state = { jobs: null };

    this.passFormData = this.passFormData.bind(this);
    this.homeReset = this.homeReset.bind(this);
  }

  homeReset() {
    this.setState({ jobs: null });
  }

  async passFormData(title, location, type) {
    this.setState({ jobs: getRequest(title, location, type) });
  }
  render() {
    console.log(typeof this.state.jobs);
    console.log(this.state.jobs);
    let pageRender = jobs => {
      if (jobs === null) {
        return <HomePage passFormData={this.passFormData} />;
      } else if (this.state.jobs instanceof Promise) {
        return <div>{"Jobs Loading"}</div>;
      } else {
        let list = this.state.jobs;
        console.log(list);
        if (typeof list === Object)
          return <div>{"Jobs Could Not Be Found"}</div>;
        return <div>{"Jobs Ready"}</div>;
      }
    };

    return (
      <div className="App">
        <Navigation homeReset={this.homeReset} />
        {pageRender(this.state.jobs)}
      </div>
    );
  }
}

export default App;
